import React from "react";
import Styled from "styled-components";

const StyledItem = Styled.ul`
  color: white;
  font-family: "Lato", sans-serif;
  font-weight: 100;
  list-style: none;
  li {
    color: #9dffad;
  }
`;

const Item = props => {
  // console.log("p> item: ", props);
  return (
    <StyledItem>
      <li>name</li>
      <li>img</li>
      <li>id</li>
    </StyledItem>
  );
};

export default Item;

